//Test for download data
function saveDiagram() {

    var data = modeler.saveJSON();

    setEncoded('wrightjs.json', data);
}

function setEncoded(name, data) {

    var encodedData = encodeURIComponent(JSON.stringify(data, 0, 4));

    var el = document.createElement('a');
    el.setAttribute('href', 'data:text/plain;charset=utf-8,' + encodedData);
    el.setAttribute('download', name);
    el.click();
}

